import React, { Fragment } from "react";
import { Card, Row, Col, Divider } from "antd";
import { EditTwoTone, DeleteTwoTone } from "@ant-design/icons";

const ReservationList = ({ data }) => {
  return (
    <Fragment>
      <Row>
        {data.map(reserv => (
          <Col key={reserv.id}>
            <Card
              key={reserv.id}
              style={{ width: "300px" }}
              className="border border-warning rounded m-2"
              title={
                <h4 className="text-center bg-light text-dark border border-dark rounded">{`Table: ${reserv.table_number}`}</h4>
              }
              cover={
                <h1 className="text-info  text-center mt-4">
                  {reserv.customer_name}
                </h1>
              }
              actions={[
                <EditTwoTone key="edit" />,
                <DeleteTwoTone twoToneColor="#ff4500" />
              ]}
            >
              <Divider />
              <Card.Meta
                title={<h4 className="text-dark">{`Seats:${reserv.seats}`}</h4>}
                description={
                  <p className="text-secondary">{`Date: ${reserv.date}`}</p>
                }
              />
            </Card>
          </Col>
        ))}
      </Row>
    </Fragment>
  );
};

export default ReservationList;
